css:
atom-text-editor {
  background-color: #0f1317;
  color: #245c94;
}
.invisible-character {
  color: transparent;
}
.indent-guide {
  box-shadow: inset 1px;
  color: #df6221;
  opacity: 0.3;
}
.selection .invisible-character {
  color: #586e75;
}
.gutter {
  background-color: #13181d;
}
.gutter .line-number {
  color: #495c6f;
  opacity: 1;
}
.gutter .line-number.folded,
.gutter .line-number:after,
.fold-marker:after {
  color: #96a9bb;
}
.cursor {
  border-color: #ffffff;
}
.selection .region {
  background-color: rgba(100, 156, 212, 0.2);
}
.line-number.cursor-line-no-selection {
  background-color: #1d252d;
}
.tab-bar .tab.active::before {
  background: #495c6f;
}
.tab-bar .tab.active[data-type="TextEditor"]::after {
  background: #0f1317;
  border-color: rgba(100, 156, 212, 0.2);
}
.bracket-matcher .region {
  background-color: #948ac4;
  opacity: 0.3;
}
.comment {
  color: #90a5c7;
  font-style: italic;
}
.entity {
  color: #e59d1b;
}
.keyword {
  color: #859900;
}
.storage.type {
  color: #859900;
}
.constant {
  color: #f2ce8d;
}
.constant.numeric,
.constant.boolean {
  color: #bdf223;
}
.variable {
  color: #bdd0de;
}
.delimiter,
.brace {
  color: #5787ab;
}
.delimiter.period {
  color: #859900;
}
.invalid.deprecated {
  text-decoration: underline;
  color: #f4c2c1;
}
.invalid.illegal {
  color: #f4c2c1;
}
.string {
  color: #e7422c;
}
.string .constant.character.escape {
  color: #f4c2c1;
}
.string.regexp {
  color: #2aa198;
}
.string.regexp .source.ruby.embedded,
.string.regexp .string.regexp.arbitrary-repitition {
  color: #f4c2c1;
}
.wrap-guide {
  background-color: transparent;
  border-left: dotted 1px #df6221;
  opacity: 0.5;
}
.source.json .leading-whitespace + .string,
.source.json .hard-tab + .string {
  color: #90a5c7;
}
.source.json .leading-whitespace + .string .punctuation,
.source.json .hard-tab + .string .punctuation {
  color: #90a5c7;
}
.source.json .key-value,
.source.json .pair {
  color: #859900;
}
.source.json .expected-dictionary-separator {
  color: #9b3912;
}
.source.json .constant {
  color: #e59d1b;
}
.source.php .keyword {
  color: #7fa1d8;
}
.source.php .keyword.operator {
  color: #90a5c7;
}
.source.php .entity:not(.inherited-class) {
  color: #bdd0de;
}
.source.php .type {
  color: #245c94;
}
.source.php .punctuation:not(.variable),
.source.php .modifier {
  color: #8ea9c3;
}
.source.php .punctuation.string {
  color: #e7422c;
}
.source.php .comment,
.source.php .comment.punctuation {
  color: #495a75;
}
.source.php .phpdoc.keyword {
  color: #516fa0;
  font-style: normal;
}
.source.php .name.function {
  color: #e59d1b;
}
.source.php .function-call {
  color: #6e87b6;
}
.source.php .constant {
  color: #e59d1b;
}
.source.php .property {
  color: #6e87b6;
}
.source.php .numeric {
  color: #bdf223;
}
